    var deferred;
    var configService;
    var sNotificationText;
    var iNotificationDuration;
    var sNotificationRouteURL;
    var oNotificationData;
    var loadDataMock = function() {
        return deferred.promise;
    };

    beforeEach(function () {
        var mockModule = angular.module("mock.module", []);
        mockModule.factory("notifier", function(){
            return {
                showInfo: function(sTitle, sText, appIdentifier_s, onCLick_fn, duration_i, notificationData_o){
                    sNotificationText = sText;
                    iNotificationDuration = duration_i;
                    sNotificationRouteURL = notificationData_o.routeURL;
                    oNotificationData = notificationData_o;
                }
            };
        });
        mockModule.service("app.customerMessages.configservice", function (){
            var Config = function(){
                this.data = {};
                this.data.settings = {};
                this.data.settings.ignore_author_action = false;
                this.data.settings.filterByOrgUnit = false;
                this.data.settings.selectedOrgUnits = [];
                this.data.settings.notificationDuration = 5000;
                this.data.selection = {};
                this.data.selection.sel_components = true;
                this.data.selection.assigned_me = true;
                this.data.selection.colleagues = true;
                this.lastDataUpdate = null;
            };

            var instances = {};
            this.getInstanceForAppId = function(appId) {
                if(instances[appId] === undefined) {
                    instances[appId] = new Config();
                }
                return instances[appId];
            };
        });

        module("app.customerMessages");
        module("mock.module");

        inject(function($injector){
            configService = $injector.get('app.customerMessages.configservice');
        });
        inject(["$rootScope", "$httpBackend", "$q", "app.customerMessages.ticketData", function (rootScope, _$httpBackend, _$q, _cmTicketData) {
            $httpBackend = _$httpBackend;
            $q = _$q;
            cmTicketData = _cmTicketData.getInstanceForAppId("test-1");

        }]);
        sNotificationText = "";
        oNotificationData = null;
    });

    it("should increase the ticket counter according to the backend data", function () {
        $httpBackend.whenGET(/https:\/\/(backup-support|bcdmain)\.wdf\.sap\.corp\/sap\/bc\/devdb\/customer_incid/).respond(mockData);
        cmTicketData.loadTicketData();
        $httpBackend.flush();
        expect(cmTicketData.prios[0].selected).toBe(0);
        expect(cmTicketData.prios[1].selected).toBe(1);
        expect(cmTicketData.prios[2].selected).toBe(2);
        expect(cmTicketData.prios[3].selected).toBe(0);
    });

    it("should reset the priorities in the data structure", function () {
        $httpBackend.whenGET(/https:\/\/(backup-support|bcdmain)\.wdf\.sap\.corp\/sap\/bc\/devdb\/customer_incid/).respond(mockData);
        cmTicketData.loadTicketData();
        $httpBackend.flush();
        expect(cmTicketData.prios[2].selected).toBe(2);

        cmTicketData.resetData();

        expect(cmTicketData.prios[0].selected).toBe(0);
        expect(cmTicketData.prios[1].selected).toBe(0);
        expect(cmTicketData.prios[2].selected).toBe(0);
        expect(cmTicketData.prios[3].selected).toBe(0);

        //expect(cmTicketData.prios[3].tickets.length).toBe(0);
    });

    it("should update correct count for selection", function(){
    	$httpBackend.whenGET(/https:\/\/(backup-support|bcdmain)\.wdf\.sap\.corp\/sap\/bc\/devdb\/customer_incid/).respond(mockData);
    	cmTicketData.loadTicketData().then(function(){
            expect(configService.getInstanceForAppId("test-1").data.selection).toBeDefined();

            configService.getInstanceForAppId("test-1").data.selection.sel_components = true;
            configService.getInstanceForAppId("test-1").data.selection.assigned_me = false;
            cmTicketData.updatePrioSelectionCounts();
            expect(cmTicketData.prios[1].selected).toBe(0);
            expect(cmTicketData.prios[2].selected).toBe(1);

            configService.getInstanceForAppId("test-1").data.selection.assigned_me = true;
            cmTicketData.updatePrioSelectionCounts();
            expect(cmTicketData.prios[1].selected).toBe(1);
            expect(cmTicketData.prios[2].selected).toBe(2);
        });
        $httpBackend.flush();
    });

    it("should set the initialized flag and get the data from the backend", function () {
        deferred = $q.defer();
        var loadDataCalled = false;

        cmTicketData.loadTicketData = loadDataMock;

        var initializePromise = cmTicketData.initialize();

        initializePromise.then(function success() {
            expect(cmTicketData.isInitialized.value).toBe(true);
            expect(loadDataCalled).toBe(true);
        });

        deferred.resolve();
    });

